// src/components/AboutUs.js

import React from 'react';
import './AboutUs.css';

const AboutUs = () => {
  return (
    <div className="about-us">
      <h1>About Us</h1>
      <p>
        Welcome to Healthify! We are dedicated to improving health and wellness through innovative technology and services. Our mission is to provide accessible and effective health solutions that empower individuals to take control of their health.
      </p>
      <p>
        At Healthify, we offer a range of services designed to support your health journey. From self-service and automation to personalized patient portals, we strive to make healthcare more efficient and user-friendly.
      </p>
      <p>
        Our team of experts is committed to delivering the highest quality of support and technology, ensuring that our solutions are always up-to-date and aligned with industry standards.
      </p>
    </div>
  );
};

export default AboutUs;
